asset.description:
A special piece combining the expertise from the mind bending sci-fi multiverse style of Cyrus James Khan and the whimsical, earthly pop-surrealist world of MUMBOT to create the first ever NFT of MUMBOT's Intellectual property. Previously existing as 2D Illustrations, paintings, toys and physical sculptures, this is the Mumbot World Characters' first introduction into a full digital world. The scene was rendered using an unbiased graphic engine for the highest level of visual fidelity.

Upon the initial sale, each piece is bundled with a physical 5K print on archival art paper and 1 "NFF - Non Fungible Fungi" micro edition of hand-painted "Shumi Mushrumi" sofubi. 

@mumbot x @cyrusjameskhan
